import React from 'react';
import '../App.css'; // Corrected path to App.css

const Header = () => (
  <div className="header">
    {/* Avatar Frame */}
    <div className="avatar-frame">
      {/* Mask Group */}
      <div className="mask-group">
        {/* Union Shape */}
        <img
          src="path/to/union-shape.svg" // Replace with actual path
          alt="Union Shape"
          className="union-shape"
        />
        {/* Mr Journaler Image */}
        <img
          src="path/to/mr-journaler-image.png" // Replace with actual path
          alt="Mr Journaler"
          className="img-mr-journaler"
        />
      </div>
    </div>

    {/* Community Button */}
    <button
      className="community-button"
      onClick={() => window.open('https://t.me/MrJournaler', '_blank')}
    >
      <span>Go to community</span>
    </button>
  </div>
);

export default Header;
